function PopupImage(props) {
    return(
        <div id="openFoto" className="popup popup_background">
            <div className="popup__content">
                <img className="popup__foto" src="https://pictures.s3.yandex.net/frontend-developer/cards-compressed/arkhyz.jpg" alt="фото"/>
                <p className="popup__foto-name"></p>
                <button type="button" className="popup__close" onClick={props.onClose}></button>
            </div>
        </div>
    );
}

export default PopupImage;
